import SearchBar from './components/SearchBar';
import searchImages from './api'

function App() {
  //Pass this down to search bar component
  const handleSubmit = (term) => {
    searchImages(term)
  };

  return (
    <div>
      <SearchBar onEnter={handleSubmit} />
    </div>
  );
}

export default App;
